import '../ProgressBox1/ProgressBox1.css';

import { Row, Col, Form, Button, Card } from 'react-bootstrap';


export class ProgressBox1 extends Component {
    render() {
        return(
            <>
                <Card style={this.props.style} className="progress-box-1">
                    <Card.Title style={{textAlign: "left", paddingLeft: "5px"}}>Card Title</Card.Title>
                    <Card.Body>This is the card body we can add more in here.</Card.Body>
                </Card>
            </>
        );
    }
}
